    "description": "Kern der bestehenden Anlage ist die westlich an die Residenzstraße grenzende Alte oder Maximilianische Residenz des frühen 17. Jahrhunderts mit der Hofkapelle (1601) und älteren Teilen des 16. Jahrhunderts, wie der Grottenhof mit Perseusbrunnen von Hubert Gerhard (1595) und Antiquarium (1569–1571), im Brunnenhof <a href=\"https://de.wikipedia.org/wiki/Wittelsbacherbrunnen_(M%C3%BCnchner_Residenz)\" title=\"Wittelsbacherbrunnen (Münchner Residenz)\">Wittelsbacherbrunnen</a> (um 1600); mit Ausstattung; - Königsbau, zweigeschossiger Südflügel mit erhöhtem Mittelteil und seitlichen Dachterrassen, im Palaststil des Quattrocento, von Leo von Klenze, 1826–1835, nach Kriegszerstörung 1956–1980 instand gesetzt; - Ehemalige Allerheiligen-Hofkirche, jetzt kultureller Veranstaltungsraum, Scheinbasilika in byzantinischen Formen mit romanisierender Fassade in Kelheimer Grünsandstein, von Leo von Klenze, 1826–1837, nach Kriegsschäden Sicherung mit Notdach durch Hans Döllgast, 1970/71, Wiederaufbau, 1986–2003; - Festsaalbau der Residenz, langgestreckte monumentale Schaufront in zwei bzw. drei Geschossen mit erhöhten Eckpavillons, vor dem Mittelrisalit Loggia mit Figuren von Ludwig Schwanthaler, Westteil unter Verwendung des Vorgängerbaues (Kaisersaaltrakt) des frühen 17. Jahrhunderts, von Leo von Klenze, 1832–1842, Umbau des östlichen Pavillons und angrenzenden Rückflügels für die Bayerische Akademie der Wissenschaften, 1957–1959; - Altes Residenztheater, sogenanntes Cuvilliéstheater, Rokoko-Logenhaus, von François de Cuvilliés, 1751–1753, nach massiver Kriegsbeschädigung am alten Standort Max-Joseph-Platz 1 Translozierung der Ausstattungsreste in den sogenannten Apothekenstock der Residenz von Klenze, 1835–1842, und dort Wiederaufbau, 1956–1958; - vergleiche auch Hofgarten.",
