    "description": "Rund 500 m langer Gruppenbau mit mehreren Höfen: Sammlungsbau im Süden, vierflügelige Anlage mit Mitteltrakt, überdachten Binnenhöfen und vorspringenden elliptischen Mittelpavillon, mit Turm und Observatoriumskuppeln, als Eisenbetonbau in neuklassizistischen Formen, nach Entwürfen von <a href=\"https://de.wikipedia.org/wiki/Gabriel_von_Seidl\" title=\"Gabriel von Seidl\">Gabriel von Seidl</a>, vollendet von <a href=\"https://de.wikipedia.org/wiki/Emanuel_von_Seidl\" title=\"Emanuel von Seidl\">Emanuel von Seidl</a> und <a href=\"https://de.wikipedia.org/wiki/Oswald_Bieber\" title=\"Oswald Bieber\">Oswald Eduard Bieber</a>, 1906–25; Bibliotheks- und Saalbau im Norden, in zwei Bauteilen mit vierflügligem Block mit Mitteltrakt um zwei Binnenhöfe als Bibliothek und ehem. Kongresssaal als basilikal gruppierter Baukörper, durch Flügel mit Uhrenturm mit dem Sammlungsbau verbunden, als <a href=\"https://de.wikipedia.org/wiki/Stahlskelettbau\" title=\"Stahlskelettbau\">Stahlskelettbau</a> in sachlichen Formen, von <a href=\"https://de.wikipedia.org/wiki/German_Bestelmeyer\" title=\"German Bestelmeyer\">German Bestelmeyer</a>, 1929–35; Kraftfahrzeughalle im äußersten Süden als Anbau an den Sammlungsbau, zweigeschossiger Walmdachbau mit großflächig verglaster Pfeilerfassade, von <a href=\"https://de.wikipedia.org/wiki/Karl_B%C3%A4%C3%9Fler_(Architekt)\" title=\"Karl Bäßler (Architekt)\">Karl Bäßler</a>, 1936–37; nach Kriegsschäden alle Bauteile bis 1959 in stilistischer Kontinuität wiederhergestellt durch Karl Bäßler; mit Ausstattung.",
