    "description": "Weitläufiger Komplex im sogenannten Korridorsystem in Formen des reduzierten Historismus mit zahlreichen Nebengebäuden. Von <a href=\"https://de.wikipedia.org/wiki/Richard_Schachner\" title=\"Richard Schachner\">Richard Schachner</a>, 1904–1913 und 1926–1928. Hauptgebäude, dreigeschossiger repräsentativer Walmdachriegel mit Mittelrisalit, altanenartigem Arkadenvorbau und Mosaiken, von Richard Schachner, 1906/1907. Krankenhauskapellen, <a href=\"https://de.wikipedia.org/wiki/Heilig_Kreuz_(Schwabing-West)\" title=\"Heilig Kreuz (Schwabing-West)\">evangelisch-lutherische und katholische Heilig-Kreuz-Kapelle</a> mit Turm. Ehemalige Schwesternhäuser, dreigeschossiger Walmdachtrakt östlich eines kreuzgangähnlichem Hofes. Verwaltungs- und Apothekengebäude, dreigeschossiger hakenförmiger Walmdachbau. Krankenhausbauten, Mittelbau mit beidseitig durch Gänge verbundene, um kleine Gartenhöfe gruppierte Seitenflügeln und Nebengebäude. Desinfektions- und Waschhaus, Gruppenbau mit Walmdächern. Kessel- und Maschinenhaus, zweigeschossiger Walmdachbau mit südseitigem Flachdachanbau. Pathologiegebäude, dreigeschossiger Walmdachbau mit Treppenhausturm. Pförtnerhaus, erdgeschossiger Walmdachbau mit polygonalem Eckerker. Einfriedung, mit zahlreichen Pavillons besetzte Ringmauer. Profanskulputur, Ziersäulen mit von Bronzeschlangen umwundenen Kelchen. Brunnenhaus, mit Schweifgiebel, von <a href=\"https://de.wikipedia.org/w/index.php?title=Maximilian_Schachner&amp;action=edit&amp;redlink=1\" class=\"new\" title=\"Maximilian Schachner (Seite nicht vorhanden)\">Maximilian Schachner</a>, 1911. Kinderkrankenhaus, viergeschossiger Walmdachbau mit Eckrisaliten und Erkern, von Richard Schachner, 1926–1928. Vgl. auch James-Loeb-Straße 2.",
