    "description": "Ursprünglich Schlösschen und Garten der Freiherren von Leublfing bzw. Grafen Preysing, jetzt Kirchliches Zentrum der Erzdiözese. Zum Teil historische Gebäudegruppe in weitem Gartengelände. An der Leonhardstraße Mauer, der Nordteil 18. Jahrhundert mit Blenden und Portalsäulen an der Innenseite; der Südteil mit Einfahrtstor um 1908 zugleich mit Bau A (siehe unten). In der Mitte das ehem. Kloster, romanisierend/gotisierender Komplex mit zwei Flügeln zu Seiten der netzgewölbten Kirche, 1841–43. Südlich davon Bau A, <a href=\"https://de.wikipedia.org/wiki/Erzbisch%C3%B6fliches_Edith-Stein-Gymnasium_M%C3%BCnchen\" title=\"Erzbischöfliches Edith-Stein-Gymnasium München\">Edith-Stein-Gymnasium</a> der Erzdiözese München und Freising, hochragender, historisierender Dreiflügelbau, 1908 von Korbinian Schmid. Aus vorklösterlicher Zeit stammen wohl Bau C (jetzt <a href=\"https://de.wikipedia.org/wiki/Deutscher_Katecheten-Verein\" title=\"Deutscher Katecheten-Verein\">Deutscher Katecheten-Verein</a>), Walmdachbau vielleicht noch des 18. Jahrhunderts; und der freistehende, langgestreckte, schlicht klassizistische Bau nordöstlich davon, 1. Hälfte 19. Jahrhundert, jetzt Referat AV-Medien.",
