    "description": "1910–11, erweitert und ergänzt 1924–27, nach Schäden im Zweiten Weltkrieg wiederaufgebaut, davon die folgenden vier baulichen Anlagen: Großmarkthalle, Eisenbeton-Hallenkonstruktion als basilikal überhöhtes, spitzbogiges Mittelschiff zwischen niedrigen Nebenräumen, von <a href=\"https://de.wikipedia.org/wiki/Richard_Schachner\" title=\"Richard Schachner\">Richard Schachner</a>, 1910–11, nach Kriegszerstörung nur Halle 1 im Süden des Komplexes noch original erhalten, und Verwaltungsflügel, über Betonbrücken erschlossen, zweigeschossig, mit Erkern und Turm gegliedert, von Richard Schachner, 1910–11, südwestlich der Halle 1 vorgelagert. Ehem. Kartoffelhalle mit Dienstwohnungen, langgestreckter eingeschossiger Bau mit dreigeschossigen Kopfbauten, von Richard Schachner, 1912, 1924 Kopfbauten aufgestockt. Städtisches Kontorhaus der Großmarkthalle, fünfgeschossiger Satteldachbau, in sachlich reduzierten Formen mit kräftiger horizontaler Gliederung aus rohem Waschbeton, von <a href=\"https://de.wikipedia.org/wiki/Karl_Meitinger\" title=\"Karl Meitinger\">Karl Meitinger</a>, 1926–27, Attikageschoss, 1950 aufgesetzt. Neues Kontorhaus und Zollverwaltungsgebäude der Großmarkthalle, fünfgeschossiger Rasterbau mit weitem Dachüberstand und Vordach, von <a href=\"https://de.wikipedia.org/wiki/Philipp_Zametzer\" title=\"Philipp Zametzer\">Philipp Zametzer</a> und Albert Heichlinger, 1952–53, erweitert von Albert Heichlinger, 1958/59; Treppenhaus mit Ausmalung.",
