    "description": "Die Gebäude des Messegeländes umschließen auf drei Seiten den Ausstellungspark (auch Bavaria- oder Theresienpark genannt), den <a href=\"https://de.wikipedia.org/wiki/Ludwig_I._(Bayern)\" title=\"Ludwig I. (Bayern)\">Ludwig I.</a> als landschaftlichen Hintergrund der Bavaria und <a href=\"https://de.wikipedia.org/wiki/Ruhmeshalle_(M%C3%BCnchen)\" title=\"Ruhmeshalle (München)\">Ruhmeshalle</a> im englischen Gartenstil anlegen ließ. – Im Messegelände samt Park zahlreiche Figuren des frühen 20. Jahrhunderts, meist von <a href=\"https://de.wikipedia.org/wiki/Theodor_Georgii_(Bildhauer)\" title=\"Theodor Georgii (Bildhauer)\">Theodor Georgii</a>: Gruppe zweier Bronzepferde auf barockisierendem Steinsockel. – Ruhender Faun (Stein), bezeichnet C. A. Bermann (Cipri Adolf Bermann). – Liegende Flussnymphe (Stein). – Zwei Gruppen von ehem. Brunnenanlage: Jüngling auf Seekuh, Jungfrau auf Einhorn (Stein). – Reiterin auf sich bäumendem Ross (Stein, von <a href=\"https://de.wikipedia.org/wiki/Carl_Ebbinghaus\" title=\"Carl Ebbinghaus\">Carl Ebbinghaus</a>). – Herkules mit Felsblock auf Stier (Stein). – Hirsch (Bronze) bezeichnet TG 1907 (Theodor Georgii). – Weibliche Herme mit Brunnenbecken (Sandstein), 1908 von <a href=\"https://de.wikipedia.org/wiki/Heinrich_D%C3%BCll\" title=\"Heinrich Düll\">Heinrich Düll</a> und <a href=\"https://de.wikipedia.org/wiki/Georg_Pezold\" title=\"Georg Pezold\">Georg Pezold</a>.",
