    "name": "Schloss Nymphenburg",
    "link": "/wiki/Schloss_Nymphenburg",
    "image": "https://de.wikipedia.org/wiki/Datei:Aerial_image_of_Schloss_Nymphenburg.jpg",
    "description": "Ehemaliger Sommersitz der bayerischen Kurfürsten und Könige. Das Schloss bildet mit dem östlich vorgelagerten halbkreisförmigen Rondell und mit dem westlich anschließenden Schlosspark und den darin verteilten Gebäuden, Figuren und Brunnen eine der weitläufigsten und geschlossensten europäischen Schlossanlagen des 17.–19. Jahrhunderts; zugeordnet sind ihm die zuführenden Alleen und Kanäle – vergleiche Ensemble Schloss Nymphenburg und Umgebung.",
    "type": "Schloss",
    "lat": "48.15817",
    "lng": "11.500944"
