    "image": "https://de.wikipedia.org/wiki/Datei:M%C3%BCnchen_-_Olympiapark_(Luftbild).jpg",
    "description": "Hauptsportstätten der <a href=\"https://de.wikipedia.org/wiki/Olympische_Sommerspiele_1972\" title=\"Olympische Sommerspiele 1972\">XX. Olympischen Sommerspiele der Neuzeit 1972</a> mit <a href=\"https://de.wikipedia.org/wiki/Olympisches_Dorf_(M%C3%BCnchen)\" title=\"Olympisches Dorf (München)\">Olympische Dorf</a> und Kernbereich des <a href=\"https://de.wikipedia.org/wiki/Olympiapark_(M%C3%BCnchen)\" title=\"Olympiapark (München)\">Olympiaparks</a>, nach gemeinschaftlicher Planung von <a href=\"https://de.wikipedia.org/wiki/Behnisch_%26_Partner\" title=\"Behnisch &amp; Partner\">Behnisch und Partner</a> für die Hauptsportstätten und die Gesamtanlage, in Zusammenarbeit mit <a href=\"https://de.wikipedia.org/wiki/Frei_Otto\" title=\"Frei Otto\">Frei Otto</a> für die Zeltdächer nach statischen Berechnungen von <a href=\"https://de.wikipedia.org/wiki/Fritz_Leonhardt\" title=\"Fritz Leonhardt\">Fritz Leonhardt</a> und <a href=\"https://de.wikipedia.org/wiki/Wolfhardt_Andr%C3%A4\" title=\"Wolfhardt Andrä\">Wolfhardt Andrä</a>, Landschafts- und Gartengestaltung von <a href=\"https://de.wikipedia.org/wiki/G%C3%BCnther_Grzimek_(Landschaftsarchitekt)\" title=\"Günther Grzimek (Landschaftsarchitekt)\">Günther Grzimek</a>, von <a href=\"https://de.wikipedia.org/wiki/Erwin_Heinle\" title=\"Erwin Heinle\">Erwin Heinle</a> und <a href=\"https://de.wikipedia.org/wiki/Robert_Wischer\" title=\"Robert Wischer\">Robert Wischer</a> für das Olympische Dorf der Männer und <a href=\"https://de.wikipedia.org/wiki/Werner_Wirsing\" title=\"Werner Wirsing\">Werner Wirsing</a> für das Olympische Dorf der Frauen (nur Teile erhalten) und Wegeleitsystem von <a href=\"https://de.wikipedia.org/wiki/Otl_Aicher\" title=\"Otl Aicher\">Otl Aicher</a>, 1967–72;<br><a href=\"https://de.wikipedia.org/wiki/Olympiastadion_M%C3%BCnchen\" title=\"Olympiastadion München\">Olympiastadion</a>, ovaloides, um Fußballfeld und Laufbahn angeordnetes, im Osten an die künstliche Aufschüttung des <a href=\"https://de.wikipedia.org/wiki/Coubertinplatz\" title=\"Coubertinplatz\">Coubertinplatzes</a> angelehntes <a href=\"https://de.wikipedia.org/wiki/Amphitheater\" title=\"Amphitheater\">Amphitheater</a> aus Stahlbeton-Modulen, über der im Westen hoch aufragenden Tribünenschüssel <a href=\"https://de.wikipedia.org/wiki/Olympiadach\" title=\"Olympiadach\">Zeltdach</a> in Form eines über Pylonen abgespannten Seilnetzes mit <a href=\"https://de.wikipedia.org/wiki/Acrylglas\" class=\"mw-redirect\" title=\"Acrylglas\">Acrylglasplatten</a>-Abdeckung; durch die segeltuchartige Akzentuierung von der Hanns-Braun-Brücke mit der Olympiahalle optisch verbunden; zugehörig Erste Hilfe-, Kassenhäuschen und Kioske, von PAS;<br><a href=\"https://de.wikipedia.org/wiki/Olympiahalle_M%C3%BCnchen\" title=\"Olympiahalle München\">Sporthalle</a>, um Sportarena angeordnetes, nach Süden an die künstliche Aufschüttung des Coubertin-Platzes angelehntes Amphitheater aus Stahlbeton-Modulen, von vielfach kurvierten Stahl-Glas-Wänden eingefasst und durch ein Zeltdach abgedeckt, das Zeltdach in Form einer über Pylonen abgespannten Seilnetzkonstruktion mit Acrylglasplatten-Abdeckung, eingehängte Technikbrücken; Mittelstück der aus Stadion, Olympiahalle und Schwimmhalle bestehenden, optisch durch die Dachformen gebundenen Dreiergruppe der großen Olympia-Sportstätten;<br><a href=\"https://de.wikipedia.org/wiki/Olympia-Schwimmhalle\" title=\"Olympia-Schwimmhalle\">Schwimmhalle</a>, von Stahl-Glas-Wänden über unregelmäßigem Grundriss eingefasste und durch ein Zeltdach abgedeckte Vierbeckenanlage mit einseitiger, an die künstliche Aufschüttung des Coubertin-Platzes angelehnter Tribüne aus Stahlbeton-Modulen im Westen, mit Zeltdach in Form einer über einem Pylon abgespannten Seilnetzkonstruktion mit Acrylglasplatten-Abdeckung; eingehängte Technikstege; durch die Überspannung des Zugangs vom Lilian-Board-Weg und vom Lutz-Long-Weg mit der Olympiahalle optisch verbunden;<br>Ehemaliges Olympisches Dorf der Männer, Wohnanlage aus drei, fingerförmig angelegten Straßenzügen, in autofreier Lage, mehrfach in Flucht und Höhe versetzte, drei- bis fünfgeschossige und sieben bis vierzehn geschossige Terrassenbauten und ein- bis dreigeschossige Reihenhäuser, mit in der Sockelzone versteckten Fahrstraßen und Parkzonen, Stahlbeton aus Fertigteilen und Ortbeton; Wegeleitsystem zur Orientierung in unterschiedlichen Farben und Symbolen von Otl Aicher; Teile des ehemaligen Olympischen Dorfes der Frauen, Studentenviertel auf dem <a href=\"https://de.wikipedia.org/wiki/Oberwiesenfeld\" title=\"Oberwiesenfeld\">Oberwiesenfeld</a>, zweigeschossige Bungalowbauten mit Flachdach und Terrasse, Stahlbeton aus Fertigteilen und Ortbeton;<br>Kernbereich des Olympiaparks, Landschaftspark mit ehemaliger Schuttberg, dem sogenannten <a href=\"https://de.wikipedia.org/wiki/Olympiapark_(M%C3%BCnchen)#Olympiaberg\" title=\"Olympiapark (München)\">Olympiaberg</a> und weiteren künstlichen Erhebungen, ein geschwungenes Wegesystem mit Blickachsen, Ruheplätzen und Kleinarchitekturen, Baumbestand aus Bergkiefern, Linden, Silberweiden und Spitzhornbäumen.",
