    "description": "Ab 1789 in den Isarauen durch <a href=\"https://de.wikipedia.org/wiki/Benjamin_Thompson\" title=\"Benjamin Thompson\">Benjamin Thompson Graf von Rumford</a> und <a href=\"https://de.wikipedia.org/wiki/Friedrich_Ludwig_Sckell\" class=\"mw-redirect\" title=\"Friedrich Ludwig Sckell\">Friedrich Ludwig von Sckell</a> angelegter Volksgarten (bis 1799 mit Militärgärten verbunden), 1792 eröffnet, ab 1799 von <a href=\"https://de.wikipedia.org/wiki/Reinhard_von_Werneck\" title=\"Reinhard von Werneck\">Reinhard Freiherr von Werneck</a> weiterentwickelt (Anlage des Sees), 1799 um die Hirschau nach Norden erweitert, ab 1804 von Friedrich Ludwig von Sckell gartenkünstlerisch umgestaltet. Klassischer Landschaftsgarten, sich über fünf Kilometer in den Isarauen erstreckend, mit geschwungenen Wasserläufen und Wegen sowie weiten Sichtflächen zwischen dem Baumbestand; Nordteil (Hirschau) rein landschaftlich, Südteil (zwischen <a href=\"https://de.wikipedia.org/wiki/Prinzregentenstra%C3%9Fe\" title=\"Prinzregentenstraße\">Prinzregentenstraße</a> und <a href=\"https://de.wikipedia.org/wiki/Isarring\" title=\"Isarring\">Isarring</a>) mit Parkbauten und Denkmälern; Brücken in großer Zahl über die Bachläufe, vielfach mit Eisen- oder Steingeländern vor allem des späten Historismus. <i>(Einzelbauwerke im Lehel, Bezirksteil Englischer Garten Süd, siehe <a href=\"https://de.wikipedia.org/wiki/Liste_der_Baudenkm%C3%A4ler_im_Lehel\" title=\"Liste der Baudenkmäler im Lehel\">Liste der Baudenkmäler im Lehel</a>)</i>.",
