    "description": "Ehemaliges kurfürstliches Jagdschloss, jetzt Exerzitienhaus, errichtet 1715–17 von <a href=\"https://de.wikipedia.org/wiki/Joseph_Effner\" title=\"Joseph Effner\">Joseph Effner</a>. Hauptbau: drei durch niedrige Zwischentrakte verbundene Pavillons. Im 2. Stock des Mittelrisalits Raum mit reichem Stuckdekor der Bauzeit. (Übrige Innenräume mehrfach erneuert). Vorhof (mit Steinvase), flankiert von langgestreckten Nebengebäuden. Diese sind durch viertelkreisförmige Mauern mit der Einfahrt verbunden, einem Gitter (18. und 19. Jahrhundert) mit von Sandsteinlöwen bekrönten Torpfeilern. Beiderseits davon kubische Pavillons (Nebengebäude). Parallel zum östlichen Hofgebäude ein weiterer Nebenbau von ca. 1880, dem Schlosskomplex angepasst. Im Südosten Gewächshaus mit anschließendem Neurenaissance-Pavillon (um 1880). Garten südlich des Schlosses, im französischen Stil. Im zentralen Parterre neubarocke Steinplastiken, 1889 von Carl Fischer: Brunnen mit Faungruppe, vier Puttengruppen und zwei Vasen. Gartenmauer mit Blenden an der Innenseite. Eine weitere Mauer umschließt den ganzen Schlosskomplex. Im Garten Bruder-Konrad-Brunnen, 18. Jahrhundert, Figur modern, und (im ehemaligen Schimmelgarten) Delphinbrunnen mit Puttengruppe, wohl um 1715. Städtebaulich zugehörig die auf das Schloss zuführende Allee, siehe Olympiastraße.",
